column13:
Verfahren zur Herstellung eines Tensid-haltigen flüssigen Reinigungsmittels mit einem pH-Wert von 7 bis 8 und einem Gewichtsanteil an Tensid von 5 bis 40 Gew.-%, enthaltend 
a) mindestens ein Fettalkoholethersulfat 
b) mindestens ein Aminoxid und/oder ein Betain 
wobei das Gewichtsverhältnis von Fettalkoholethersulfat zu Aminoxid/Betain 3:2 bis 10:1 beträgt, 
umfassend die aufeinander folgenden Schritte 
i) Bereitstellen eines Lösungsmittelsystems mit einem pH-Wert außerhalb des Bereichs von 7 bis 8; 
ii) Einbringen des Fettalkoholethersulfats in das Lösungsmittelsystem mit einem pH-Wert außerhalb des Bereichs von 7 bis 8 und nachfolgendes Vermischen; 
iii) Einbringen weiterer Aktivstoffe und nachfolgendes Vermischen; 
iv) Einstellen des pH-Wertes der resultierenden Mischung auf einen pH-Wert von 7 bis 8.

Verfahren zur Herstellung einer Handgeschirrspülzusammensetzung umfassend die Schritte: Bereitstellen wenigstens eines Tensides; 
Bereitstellen wenigstens ein anorganisches Salzes; 
Bereitstellen von organischem Lösungsmittel, und 
Einstellen des pH-Wertes der Zusammensetzung auf einen Wert zwischen 7 und 8,5, dadurch gekennzeichnet, dass 
das Bereitstellen des Lösungsmittels vor der Einstellung des pH-Wertes erfolgt.

A folding table arrangement (1) for a vehicle seat back (2), including a table leaf unit (4) which is movable between a stowed position and a substantially horizontal in-use position. Two support brackets (9) are positioned on each lateral side of the table leaf unit (4), each support bracket (9) being provided with a guide rail (13) adapted for sliding engagement with a guide pin (14) protruding from each lateral side (10) of the table leaf unit (4). The guide rail (13) further includes a fold-out track (15) extending upwardly from a lower end (16) to an upper end (17) thereof, said lower end (16) forming a parking position for the guide pin (14) in said stowed position of the table leaf unit (4). The invention is especially characterized in that: 
- two coaxially arranged swivel pins (18), one protruding from each lateral side (10) of the table leaf unit (4), are provided at a distance from and parallel with said guide pins (14); 
- the guide rail (13) further includes a separate fold-in return track (21) having a curved upper track section (22), the mean radius of which corresponds to the axial distance (d) between the swivel pin (18) and the guide pin (19); 
- said fold-in return track (21) also includes a substantially straight lower track section (23) ending in said parking position for the guide pin (14) in the stowed position of the table leaf unit (4).
